import React from "react";
import "./Ellipse5.css";

function Ellipse5() {
  return (
    <div className="ellipse-5">
      <img
        className="game-iconsmusical-score"
        src="https://anima-uploads.s3.amazonaws.com/projects/6492c55c74995fc792d0df14/releases/6493fbc959e3e5a943ada352/img/game-icons-musical-score.svg"
        alt="game-icons:musical-score"
      />
    </div>
  );
}

export default Ellipse5;
